sap.ui.define([
    "sap/ui/core/mvc/Controller",
    "sap/ui/model/json/JSONModel",
    "sap/ui/model/Filter",
    "sap/ui/model/FilterOperator",
    "sap/m/MessageBox",
    "sap/m/Dialog",
    "sap/m/DialogType",
    "sap/m/ProgressIndicator",
    "sap/m/Text",
    "sap/m/Button",
    "sap/m/VBox",
], (Controller, JSONModel, Filter, FilterOperator, MessageBox, Dialog, DialogType, ProgressIndicator, Text, Button, VBox) => {
    "use strict";

    return Controller.extend("com.alm.hackaton.controller.Projects", {
        async onInit() {
            const oODataModel = this.getOwnerComponent().getModel(); // OData V4
            const oTable = this.byId("projectsTable");

            // 1. Criar binding para a entidade
            const oBinding = oODataModel.bindList("/Projects");

            // 2. Disparar a leitura real
            const aContexts = await oBinding.requestContexts();

            // 3. Extrair os dados JSON de cada contexto
            const aData = aContexts.map(oCtx => oCtx.getObject());

            // 4. Criar JSONModel local
            const oJsonModel = new JSONModel(aData);

            // 5. Atribuir à view e reconfigurar a tabela para usar esse modelo
            this.getView().setModel(oJsonModel, "local");

        },

        onSearch(oEvent) {
            const sQuery = oEvent.getParameter("newValue"); // se usar liveChange
            // const sQuery = oEvent.getParameter("query"); // se usar search

            // pega a tabela
            const oTable = this.byId("projectsTable");
            const oBinding = oTable.getBinding("items");

            debugger

            if (sQuery && sQuery.length > 0) {
                // cria filtros locais (no modelo já carregado no front)
                const aFilters = [
                    new Filter("name", FilterOperator.Contains, sQuery),
                    // new Filter("purpose", FilterOperator.Contains, sQuery),
                    // new Filter("status", FilterOperator.Contains, sQuery)
                ];

                // aplica com operador OR (procura em qualquer campo)
                oBinding.filter(new Filter({
                    filters: aFilters,
                    and: false
                }));
            } else {
                // sem filtro = mostra tudo
                oBinding.filter([]);
            }
        },

        handleProcess(oEvent) {
            const that = this
            MessageBox.confirm("Você deseja realizar o processamento do projeto selecionado?", {
                actions: [MessageBox.Action.OK, MessageBox.Action.CANCEL],
                emphasizedAction: MessageBox.Action.OK,
                onClose: function (sAction) {
                    if( sAction === "OK") {
                        that.onProcess(oEvent)
                    }
                },
                dependentOn: this.getView()
            });
        },

        async onProcess(oEvent) {
            // const context = oEvent.getSource().getBindingContext().getValue()
            // console.log(context)

            let progress = 0;
            let phase = 1;

            const oProgress = new ProgressIndicator({
                percentValue: progress,
                displayValue: progress + "%",
                showValue: true,
                width: "100%",
                state: "None"
            });

            const oPhaseText = new Text({ text: "Fase " + phase });

            const closeButton = new Button({
                text: "Fechar",
                enabled: false,
                press: () => this._oDialog.close(),
            })

            const oVBox = new VBox({
                items: [oPhaseText, oProgress],
                alignItems: "Center",
                justifyContent: "Center",
                width: "100%",
                renderType: "Bare"
            });

            this._oDialog = new Dialog({
                title: "Gerando relatório",
                type: DialogType.Message,
                content: oVBox,
                showHeader: true,
                showFooter: true,
                draggable: true,
                resizable: false,
                beginButton: closeButton,
                escapeHandler: (oPromise) => {
                    // se você não resolver o promise, o dialog não fecha
                    oPromise.reject();
                }
            });

            this.getView().addDependent(this._oDialog);
            this._oDialog.open();

            this._interval = setInterval(() => {
                progress += 25;
                oProgress.setPercentValue(progress);
                oProgress.setDisplayValue(progress + "%");
                oPhaseText.setText("Fase " + phase);

                phase++;

                if (progress >= 100) {
                    clearInterval(this._interval);
                    // Opcional: fechar automaticamente após completar
                    setTimeout(() => {
                        oPhaseText.setText("Processamento concluído!");
                        oProgress.setVisible(false)
                        closeButton.setEnabled(true)

                        this.downloadPdfFromBase64()
                    }, 500);
                }
            }, 1000);

        },

        downloadPdfFromBase64(fileName = "report.pdf") {
            // Converter base64 para binário
            const byteCharacters = atob('');
            const byteNumbers = new Array(byteCharacters.length);

            for (let i = 0; i < byteCharacters.length; i++) {
                byteNumbers[i] = byteCharacters.charCodeAt(i);
            }

            const byteArray = new Uint8Array(byteNumbers);

            // Criar Blob tipo PDF
            const blob = new Blob([byteArray], { type: "application/pdf" });

            // Criar link temporário e forçar download
            const link = document.createElement("a");
            link.href = URL.createObjectURL(blob);
            link.download = fileName;
            link.click();

            // Limpar URL temporária
            URL.revokeObjectURL(link.href);
        }
    });
});